// Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import { Button, TextField ,Typography} from '@mui/material';

const Navbar = ({ searchQuery, setSearchQuery, handleSearch, handleOpenAddModal }) => {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '10px' }}>
      <Typography variant="h2" style={{ marginBottom: '20px', fontFamily: 'Arial' }}>
        Contact List
      </Typography>
      <div style={{ display: 'flex', alignItems: 'center' }}>
        <TextField
          type="text"
          placeholder="Search"
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
        <Button variant="contained" onClick={handleSearch} style={{ marginLeft: '10px' }}>
          Search
        </Button>
        <Button variant="contained" color="primary" onClick={handleOpenAddModal} style={{ marginLeft: '10px' }}>
          Add Contact
        </Button>
      </div>
    </div>
  );
};

export default Navbar;
